import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      string: "Hello world!!",
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>{this.state.string}</p>
          <button
            onClick={() =>
              this.setState({ string: `Bye world ${Math.random().ceil() * 5}` })
            }
          >
            Press me
          </button>
        </header>
      </div>
    );
  }
}

export default App;
